import React from "react";

const HomePage = () => {
  const getCountriesData = async () => {
    const result = await fetch("https://disease.sh/v3/covid-19/countries");
    const res = await result.json();
    return res;
  };

  return <div>Homepage</div>;
};

export default HomePage;
